import React from 'react';
import { RouteObject } from 'react-router-dom';

import Discover from '@/views/discover';
import Mine from '@/views/mine';

const routes: RouteObject[] = [
  {
    path: '/discover',
    element: <Discover />
  },
  {
    path: '/mine',
    element: <Mine />
  },
  {
    path: '/focus',
    element: <Focus />
  },
  {
    path: '/discover',
    element: <Discover />
  }
];

export default routes;
